18% of the person’s disposable earnings for the relevant workweek if the person’s gross weekly salary or wage on the date the most recent writ of garnishment was issued was $770 or less;
25% of the person’s disposable earnings for the relevant workweek if the person’s gross weekly salary or wage on the date the most recent writ of garnishment was issued exceeded $770; or
(c) The amount by which the person’s disposable earnings for that week exceed 50 times the federal minimum hourly wage prescribed by section 206(a)(1) of the federal Fair Labor Standards Act of 1938, 29 U.S.C. §§ 201 et seq., in effect at the time the earnings are payable
